import React from 'react';
import { Menu } from 'antd';

const MyMenu = ({ models, setModel }) => {
  const handleMenuClick = (e) => {
    setModel(e.key);
  };

  return (
    <Menu onClick={handleMenuClick} mode="horizontal">
      {models.map((model) => (
        <Menu.Item key={model.name}>
          {model.name}
        </Menu.Item>
      ))}
    </Menu>
  );
};

export default MyMenu;
